import React, { Component } from "react";
import Node from "./node/node";

class Pathing extends Component {
    constructor(props) {
        super(props);
        this.state = { grid: [], clickList: ['isStart', 'isFinish', ] };
    }

    componentDidMount() {
        const grid = [];
        for (let row = 0; row < 10; row++) {
            const currentrow = [];
            for (let col = 0; col < 10; col++) {
                currentrow.push(this.createNode(row, col));
            }
            grid.push(currentrow);
        }
        this.setState({ grid });
    }

    createNode(col, row) {
        return { col, row };
    }

    render() {
        const { grid } = this.state;
        console.log("full grid", grid);

        return (
            <div>
                <button>Start</button>
                <div className="grid">
                    <div className="nodes">
                        {grid.map((row, rowindex) => {
                            return (
                                <div key={rowindex}>
                                    {row.map((node, nodeindex) => {
                                        const { row, col } = node;
                                        return (
                                            <Node
                                                key={nodeindex}
                                                row={row}
                                                col={col}
                                            ></Node>
                                        );
                                    })}
                                </div>
                            );
                        })}
                    </div>
                </div>
            </div>
        );
    }
}

export default Pathing;
